import React from "react";
import Navbar from "./Navbar";
import Footer from "./Footer";
// import { Link } from "react-router-dom"; // Assuming you're using react-router for navigation
// import './Homepage.css'; // Add your custom CSS for styling

export default function Homepage({ viewer, setViewer, isExpanded, setIsExpanded }) {
    return (
        <div className="homepage-container">
            <Navbar viewer={viewer} setViewer={setViewer} />

            <section className="hero-section">
                <div className="hero-content">
                    <h1>Hi, I'm [Your Name]</h1>
                    <p>Junior Software Engineer at Iowa State University</p>
                    <p>I create web applications and love to solve problems with code. Welcome to my portfolio!</p>
                </div>
            </section>

            <section className="intro-section">
                <h2>Welcome to My Portfolio</h2>
                <p>
                    I'm a passionate software engineer currently studying at Iowa State University. On this website, you can
                    explore my skills, check out some of the projects I've worked on, download my resume, or get in touch with me!
                </p>

                <div className="links">
                    {/* <Link to="/projects" className="link-button">View My Projects</Link>
                    <Link to="/skills" className="link-button">My Skills</Link>
                    <Link to="/resume" className="link-button">Download My Resume</Link>
                    <Link to="/contact" className="link-button">Contact Me</Link> */}
                </div>
            </section>

            <Footer />
        </div>
    );
}
